package com.lianshang.rmq.biz.service;

import java.util.Date;

import com.lianshang.rmq.api.dto.MessageRecord;
import com.lianshang.rmq.api.query.MessageRecordQuery;
import com.lianshang.rmq.api.service.MessageRecordService;
import com.lianshang.rmq.biz.BaseTest;
import org.junit.Test;
import java.util.List;
import org.springframework.beans.factory.annotation.Autowired;

public class MessageRecordServiceTest extends BaseTest {

	@Autowired
	private MessageRecordService messageRecordService;

    @Test
    public void testDate() {
        System.out.println(new Date(0));
    }

	@Test
	public void test() {

		MessageRecord messageRecord =  mockAddData();

		Long idAdd = messageRecordService.add(messageRecord);
		assert idAdd > 0;
		messageRecord.setId(idAdd);

		messageRecord = messageRecordService.load(messageRecord.getId());
		System.out.println(messageRecord);

		messageRecord = mockUpdateData(messageRecord);
		Long idUpdate = messageRecordService.update(messageRecord);
		assert idUpdate > 0;

		int queryCount = messageRecordService.queryCount(new MessageRecordQuery());
		assert queryCount > 0;

		List<MessageRecord> queryList  = messageRecordService.query(new MessageRecordQuery(),1, 20);
		assert queryList.size() > 0;
		System.out.println(queryList);

	}

	private MessageRecord mockAddData() {

		MessageRecord messageRecord = new MessageRecord();
		messageRecord.setId(161950458L);
        messageRecord.setMessageId(132132L);
		messageRecord.setTopic("qhoegpnxzwqbzrevgxjtzqggjhhqzcaxezjsfbrkwienwhnjgynchscsw");
		messageRecord.setProducerIp("gyhsvwbjnjmfcygh");
		messageRecord.setBirthTime(new Date());
		messageRecord.setContent("");
		messageRecord.setValidity((byte)4);
		messageRecord.setCreateTime(new Date(1456827688425L));
		messageRecord.setUpdateTime(new Date(1456827845051L));

		return messageRecord;
	}

	private MessageRecord mockUpdateData(MessageRecord messageRecord) {

		MessageRecord messageRecordUpdate = new MessageRecord();
		messageRecordUpdate.setId(messageRecord.getId());
        messageRecordUpdate.setMessageId(554654L);
		messageRecordUpdate.setTopic("vthiiwalfbhngbwofdsleyvamcscfigbxphwelnbadlwayvuqcyjrszhy");
		messageRecordUpdate.setProducerIp("vvplhjam");
		messageRecordUpdate.setBirthTime(new Date());
		messageRecordUpdate.setContent("");
		messageRecordUpdate.setValidity((byte)6);
		messageRecordUpdate.setCreateTime(new Date(1456827786166L));
		messageRecordUpdate.setUpdateTime(new Date(1456827863462L));

		return messageRecordUpdate;
	}

}
